IN _tipo int,
IN _titulo varchar(100),
IN _descripcion varchar(1000),
IN _extension varchar(100)
)
BEGIN

DECLARE EXIT HANDLER FOR SQLEXCEPTION, SQLWARNING
BEGIN
    ROLLBACK;
    SELECT 'E0666' AS ERROR, 'SQLEXCEPTION' AS MESSAGE;
END;

START TRANSACTION;

	SET @codigo:=UUID();
    
    IF _tipo=1 THEN
    
		INSERT INTO galeria (
			usuario_id, 
			planta_id, 
			codigo, 
			extension, 
			titulo, 
			descripcion
		)
		VALUES (
			_usuarioid,
            _id,
            @codigo,
            _extension,
            _titulo,
            _descripcion
		);
        
    ELSE
    
		INSERT INTO galeria (
			usuario_id, 
			pez_id, 
			codigo, 
			extension, 
			titulo, 
			descripcion
		)
		VALUES (
			_usuarioid,
            _id,
            @codigo,
            _extension,
            _titulo,
            _descripcion
		);
        
    END IF;
            
    SELECT 1 AS IMAGE_STATUS, codigo AS CODIGO FROM galeria where id = LAST_INSERT_ID();
    
COMMIT;

END ;;
